import { Component, OnInit } from '@angular/core';
import { Buy } from '../buy';
import { BuyService } from '../buy.service';
import { Router } from '@angular/router';
import { ProductQuantity } from '../product-quantity';
import swal from 'sweetalert2';
import { Product } from '../product';

@Component({
  selector: 'app-register-buy',
  templateUrl: './register-buy.component.html',
  styleUrls: ['./register-buy.component.css']
})
export class RegisterBuyComponent implements OnInit {

compra: Buy = new Buy();
productQuantity:ProductQuantity;
productId: number;
quantity:number;

products: ProductQuantity[] = [];

constructor(private compraService:BuyService, private router:Router){}


ngOnInit(): void {

}

guardarCompra(){
  const productQuantity: ProductQuantity ={
    idProduct: this.productId,
    quantity: this.quantity
  }

 // const productQuantity= this.compraService.obtenerListaDeProductos();
  this.compra.products = [productQuantity];
  //this.products = [productQuantity];

    this.compraService.registrarCompra(this.compra).subscribe(
      dato => {
      console.log(dato);
      this.irALaListaDeCompras();
    }, error => console.log(error));
}





// guardarCompra(){
//   this.compraService.registrarCompra(this.compra).subscribe(dato => {
//       console.log(dato);
//       this.irALaListaDeCompras();
//     }, error => console.log(error));
// }


irALaListaDeCompras(){
  this.router.navigate(['/compras'])
}


onSubmit(){
 this.guardarCompra();
}



obtenerListaDeProductos(): ProductQuantity[]{
  return this.compraService.obtenerListaDeProductos();
}



}
<div class="col-md-6 offset-md-3">
    <h3 class="text-center">Registro de compra</h3>
    <form (ngSubmit)="onSubmit()" #compraForm= "ngForm">

        <div class="form-group">
            <label>Nombre de cliente :</label>
            <input type="text" 
            class="form-control" 
            id = "nombre_cliente"
            [(ngModel)]="compra.clientName"
            name = "clientName"
            required
            minlength="4"
            maxlength="15"
            placeholder ="Escriba el nombre del cliente :"
            #clientName = "ngModel">

            <div class="alert alert-danger" *ngIf= "clientName.invalid && (clientName.dirty || clientName.touched )">
                <div *ngIf= "clientName.errors.required">
                    El nombre del productodebe tener como minimo 4 caracteres
                </div>


            </div>

        </div>

        <div class="form-group">
            <label>Tipo de documento :</label>
            <select class="form-control" 
            id = "identificacion" 
            [(ngModel)]="compra.idType" 
            name = "idType" equired
            #idType = "ngModel">

                <option value="CC">Cedula de ciudadania</option>
                <option value="CE">Cedula de extranjeria</option>
                <option value="TI">Tarjeta de identidad</option>
                <option value="CD">Pasaporte</option>
            </select>





        </div>

        <div class="form-group">
            <label>Numero de indentificación :</label>
            <input type="text" 
            class="form-control" 
            id = "dni_holi"
            [(ngModel)]="compra.dni"
            name = "dni"
            required
            minlength="1"
            maxlength="10"
            placeholder ="Ingrese número de indentificación"
            #dni = "ngModel"
            >
            <div class="alert alert-danger" *ngIf= "dni.invalid && (dni.dirty || dni.touched )">
                <div *ngIf= "dni.errors.required">
                    Ingrese un numero de indentificación
                </div>

            </div>

        </div>

        <div class="form-group">
            <label>ID del Producto:</label>
            <input type="number"
             class="form-control"
            [(ngModel)]="productId" 
            name="productId" 
            required 
            placeholder="Ingrese el ID del producto" 
            #inputProductId = "ngModel">

        </div>

          <div class="form-group">
            <label>Cantidad:</label>
            <input type="number" 
            class="form-control" 
            [(ngModel)]="quantity" 
            name="quantity" 
            required
            placeholder="Ingrese la cantidad"
            #inputQuantity = "ngModel">

           </div>

        <button class="btn btn-success" [disabled]= "!compraForm.form.valid">Guardar</button>

    </form>

</div>
